import React, {Component} from 'react';
import classes from './QuizList.css'

class QuizList extends Component {
    renderQuizes = () => {
        return
        [1, 2, 3].map((quiz, index) => {
            return (
                <li key={index}>
                    
                </li>
            )
        })
    }

    render() {
        return (
            <div className={classes.QuizList}>
                <div>
                    <h1>Список тестов</h1>
                </div>

                <ul>
                    {this.renderQuizes()}
                </ul>
            </div>
        );
    }
}

export default QuizList;
